import React from 'react'
import '../Stylesheets/nav-bar.css'

const navbar=()=>{
    return(
        <div id='navbar'>
            <div id='logofield'>
                <div id='logo'>
                        <h1>INSI</h1>
                    </div>
            </div>
            <div id='navbar-items'>
                
            </div>
        </div>
    );
}
export default navbar;
